
import { useState } from 'react';
import * as style from '@/pages/home/timesetting.style';
import PrevIcon from '@/assets/images/PrevArrow.svg';
import RepeatDaySetting from '@/components/pages/home/repeat-day-setting';
import { TimeType } from '@/constants/types/signUpTypes';
import TimePicker from '@/components/common/time-picker';
import { TimePickerProps } from '@/components/common/time-picker/TimePicker';

import SwiperCore from 'swiper';
import MusicPlay from '@/components/common/music-play';
import { PlayListSettingType } from '@/constants/types/playlistSettingTypes';
import { start } from 'repl';
import { Album } from '~/src/components/common/album/Album';




interface Playlist {
    repAlbumImageUrl: string;
    playlistTitle: string;
    playlistId:number;
  }
  
const TimeSetting = ({
    meridiem,
    hour,
    min,
    onChangeMeridiem,
    onChangeHour,
    onChangeMin,
  }: TimePickerProps
  ) => {
    const playlists: Playlist[] = [
        {
            repAlbumImageUrl: 'data:image/jpeg;base64,',
            playlistTitle: 'Playlist 1',
            playlistId:1
          },
          {
            repAlbumImageUrl: 'data:image/jpeg;base64,',
            playlistTitle: 'Playlist 2',
            playlistId:2,
          },
          {
            repAlbumImageUrl: 'data:image/jpeg;base64,',
            playlistTitle: 'Playlist 3',
            playlistId:3
          },
          {
              repAlbumImageUrl: 'data:image/jpeg;base64,',
              playlistTitle: 'Playlist 1',
              playlistId:1
            },
            {
              repAlbumImageUrl: 'data:image/jpeg;base64,',
              playlistTitle: 'Playlist 2',
              playlistId:2,
            },
            {
              repAlbumImageUrl: 'data:image/jpeg;base64,',
              playlistTitle: 'Playlist 3',
              playlistId:3
            },
          // ...   
      ];

      const [alarmTime,setAlarmTime] =useState<TimeType>( {
        meridiem: 'AM',
        hour: 1,
        min: 0,
      });

      const [renderingStartTime,setRenderingStartTime] = useState("01:00");
    const handleMeridiem = (meridiem: string) => {
        
        setAlarmTime({
            ...alarmTime,
            meridiem:meridiem ,
          });
        
      };

    function handleHour(swiper: SwiperCore): void {
        
        setAlarmTime({
            ...alarmTime,
            hour:swiper.realIndex + 1 ,
          });
          

    }

    function handleMin(swiper: SwiperCore): void {
        setAlarmTime({
            ...alarmTime,
            min: swiper.realIndex*10  ,
          });
    }

    return(
        <style.Wrapper>
            <style.TopBarBox>
                <PrevIcon/>
                <style.NextButton></style.NextButton>
            </style.TopBarBox>
            <style.BigTimeBadge>
                <style.StartTimeDiv>
                    <style.TimeTitle>Start</style.TimeTitle>
                    <style.TimeText>{renderingStartTime}</style.TimeText>
                </style.StartTimeDiv>
                <style.DoneTimeDiv>
                    <style.TimeTitle>Done</style.TimeTitle>
                    <style.TimeText>20:59</style.TimeText>
                </style.DoneTimeDiv>
            </style.BigTimeBadge>
            <style.TimePickerBox>
                <TimePicker
                meridiem={alarmTime.meridiem}
                onChangeMeridiem={handleMeridiem}
                hour={alarmTime.hour}
                onChangeHour={handleHour}
                min={alarmTime.min}
                onChangeMin={handleMin}
                />
            </style.TimePickerBox>   
            <RepeatDaySetting/>
            <style.MyPlaylistContainer>
                <style.Text>My Playlist</style.Text>
                <style.MyPlaylistBox>
                    {playlists.map(({playlistId,repAlbumImageUrl,playlistTitle}) => (
                        <style.PlaylistInfo  onClick = {() => {console.log(playlistTitle)}}>
                            <Album url={repAlbumImageUrl} size={81.5} />
                            <style.PlaylistTitle>{playlistTitle}</style.PlaylistTitle>
                        </style.PlaylistInfo>
            ))}
                </style.MyPlaylistBox>
            </style.MyPlaylistContainer>
            
        </style.Wrapper>
    )
}

export default TimeSetting;